import { useState } from "react";
import Event from "./Event";

const Events = () =>
{
    const [events, setEvent] = useState
    ([
        {name: 'Линейка', date: '01.09.2023', time: '09:00', body: 'Долгожданная линейка первоклассников', place: 'Задний двор школы'},
        {name: 'Родительское собрание', date: '05.09.2023', time: '18:00', body: 'Беседа инспектора с родителями школьников', place: 'Актовый зал'}
    ])


    return (
        <div>
            {events.map(event =>
                <Event event = {event} />
                )}
        </div>
    )
}

export default Events;
